import React from 'react'
import {Link, Outlet} from'react-router-dom';
import './Nav.css';
import Dashboard from './Dashboard';
const Dash = ()=> {
    return(
        <>
    <div>
        <div>
            <ul className="cont">
                <li className="con"><Link to="/dashboard/view/viewcategories">View Categories</Link></li>
                <li className="con"><Link to="/dashboard/view/viewmainproducts">View Products</Link></li>
                <li className="con"><Link to="/dashboard/view/viewsubproducts">View SubProducts</Link></li>
                
            </ul>
            <Outlet/>
        
        </div>
    </div>
    </>
    );
    
}
export default Dash
